import React from "react";
import styled from "styled-components";
import { NavLink } from "react-router-dom";

const LeftbarPositioner = styled.div`
  width: 7rem;
  height: 100vh;
  text-color: "#A259FF";
`;

const LeftbarHeader = styled.div`
  text-align: center;
  padding-bottom: 0.5rem;
  border-bottom: solid;
  margin-top: 1rem;
`;

const LeftbarBody = styled.div`
  display: flex;
  flex-direction: column;
  text-align: center;
  margin-top: 1rem;
`;

const activeStyle = {
  color: "#A259FF",
};

function Sidebar() {
  return (
    <LeftbarPositioner>
      <LeftbarHeader>MY SPACE</LeftbarHeader>
      <LeftbarBody>
        <NavLink to="/mystage/create" activeStyle={activeStyle}>
          명함만들기
        </NavLink>
        <NavLink to="/mystage/repository" activeStyle={activeStyle}>
          명함보관함
        </NavLink>
      </LeftbarBody>
    </LeftbarPositioner>
  );
}

export default Sidebar;
